The interface returns results asynchronously so that inference requests can be made as fast as the system can support, without blocking on output data being returned. This way, it also supports running multiple requests concurrently. Before any compute is started a job with associated input and output buffers needs to be registered with the runtime using one of vollo_rt_add_job_bf16 or vollo_rt_add_job_fp32. The bf16 variant uses bfloat16 which is effectively a cropped version of single precision floating point format fp32 (same exponent, smaller mantissa). Note: do NOT use C floating point literals for bf16 as it is simply a uint16_t in the API A fp32 variant is also provided despite the Vollo accelerator expecting its inputs and outputs to be in fp16. If you are working with fp32, prefer this version instead of the bf16 variant as it is able to make the conversion while copying to/from DMA buffers, avoiding an extra copy. /** * Sets up a computation on the vollo accelerator where the inputs and outputs are in brain-float 16 * format. * * Note: The computation is only started on the next call to vollo_rt_poll. This way it is possible * to set up several computations that are kicked off at the same time. * * - vollo: * the context that the computation should be run on * - model_index: * the model to run * - user_ctx: * a user context that will be returned on completion. This can be used to disambiguate when * multiple models are running concurrently. * NOTE: the jobs for a single model are guaranteed to come back in order, but the jobs for * different models are not. * - input_data: * a pointer to the start of an array with pointers to the start of the data to each input the * number of inputs is given by `vollo_rt_model_num_inputs` each input length is the product of * the shape given by `vollo_rt_model_input_shape` * (or more convenient: `vollo_rt_model_input_num_elements`) * lifetime: * - The outer array only needs to live until `vollo_rt_add_job_bf16` returns * - The input buffers need to live until `vollo_rt_poll` returns with the completion for * this job * - output_data: * a pointer to the start of an array with pointers to the start of the data to each output * buffer the number of outputs is given by `vollo_rt_model_num_outputs` each output length is * the product of the shape given by `vollo_rt_model_output_shape` * (or more convenient: `vollo_rt_model_output_num_elements`) * lifetime: * - The outer array only needs to live until `vollo_rt_add_job_bf16` returns * - The output buffers need to live until `vollo_rt_poll` returns with the completion for * this job */
vollo_rt_error_t vollo_rt_add_job_bf16( vollo_rt_context_t vollo, size_t model_index, uint64_t user_ctx, const bf16* const* input_data, bf16* const* output_data); vollo_rt_error_t vollo_rt_add_job_fp32( vollo_rt_context_t vollo, size_t model_index, uint64_t user_ctx, const float* const* input_data, float* const* output_data); To actually start and later complete an inference you must use the vollo_rt_poll function multiple times. It is typically called in a loop (with a timeout) until some or all of the jobs are completed. /** * Poll the vollo accelerator for completion. * * Note: Polling also initiates transfers for new jobs, so poll must be called * before any progress on these new jobs can be made. * * num_completed: out: the number of completed user_ctx returned * returned_user_ctx: buffer for the returned user_ctx of completed jobs, this will only be * valid until the next call to vollo_rt_poll. */
vollo_rt_error_t vollo_rt_poll( vollo_rt_context_t vollo, size_t* num_completed, const uint64_t** returned_user_ctx);

